import React from 'react';
import ReactDOM from 'react-dom';
import CarouselIndicators from './CarouselIndicators'
import CarouselInner from './CarouselInner'
import './Carousel.css'
import clothes from '../../../img/clothes.jpg'
import students from '../../../img/students.jpg'
import friends from '../../../img/friends.jpg'
import soldure from '../../../img/soldure.jpg'
import { Button,Carousel } from 'react-bootstrap';
import Items from './CarouselItems'
class MyCarousel extends React.Component {
  constructor(props)
  {
    super(props);
  }

  render() {
    const carouselItems = Items.map((singleItem) =>
                      <CarouselItem item={singleItem} />
                    );
    return (
      <Carousel>
        {carouselItems}
      </Carousel>
    );
  }
}

export default MyCarousel;
